Here is how we implemented the Record part. impl Record for Task { type Allocator = DefaultIdAllocator; fn get_id(&self) -> Id<Task> { self.id } fn set_permanent_id( &mut self, value: <Self::Allocator as TemporaryIdAllocator>::Type ) -> Result<(), record::IdentityError> { self.id = Id::from(value); Ok( () ) }
} There are two methods and one type defined there. Method get_id is rather self explanatory. It returns current value of record identifier which we discussed in Task structure section. Method set_permanent_id overrides current value of id with new stable final version of identifier. It's responsibility of the data store and backend to track down this information and propagate it. Why would you need something like that? The scenario I was solving for myself is "how application should behave in presence of slow backend". Without this feature when I commit a record to the slow backend I need to wait for the backend to respond with information about saving the record and I under which this record was saved before I can safely show it to user. Other method would be to track down which records are committed and which not. This might involve things like remembering that record without id at the 5th position of some list is the one which should be updated when 2nd http request is successful. It sound painful. Implementing it definitely is. Even if we assume you can do it bug free. Write it down 3 times for slightly different scenarios. So how did we solve it then? By making it data definition problem. Id must be unique. Two instances of the Task are considered to represent same record at maybe different point of time if their id is equal In scope of the application, you must be able to return new unique id's during whole application lifetime. This allows you to provide temporary id's which are unique in currently running application. It doesn't matter if two running applications provide same unique id because when records from other application will be visible to this application only after being committed to the backend (for example database) which in turn would make them contain permanent id instead of temporary one. So this application will never see temporary id of other application You are not allowed to keep copy of records with non permanent id. In most cases it's not an issue. Since after you create a record anc commit it to the database you don't really have a reason to keep copy of it. If for some reason you must keep the record around you are responsible for tracking this information Only backend is allowed to call set_permanent_id I'm going to elaborate little bit more about 4th point. To make it clear how bad it's to call it outside of the backend. Let's assume you have a record like that struct User { id: Id<User>, pub name: String,
} impl Record for User { type Allocator = UserIdAllocator; fn get_id(&self) -> Id<Task> { self.id } fn set_permanent_id( &mut self, value: <Self::Allocator as TemporaryIdAllocator>::Type ) -> Result<(), record::IdentityError> { self.id = Id::from(value); Ok( () ) }
} Somewhere in the code you've created a code like this: fn new_user_from(mut u: User) -> User { let id = UserIdAllocator::getId(); u.set_permanent_id()
} You compile and test your application. Everything works. Now few request later you change the user definition: struct User { id: Id<User>, pub name: String, // must be unique across all users pub unique_email: String,
} Your code still compiles. But now anytime you invoke the new_user_from you produce a value which breaks your business model a little bit. If you are not really careful with your tests this error might live in your code base for very long time. I've seen bugs similar to this one living in the production systems for years. Fixing them afterwards is at least problematic and more often impossible.

