} impl Sorter<Task> for OrderTasksBy { fn cmp(&self, lhs: &Task, rhs: &Task) -> std::cmp::Ordering { match self { OrderTasksBy::Name{ascending} => { if *ascending { lhs.description.cmp(&rhs.description) } else { lhs.description.cmp(&rhs.description).reverse() } }, } }
