This part is provided for you by the relm4-store as relm4-store-record::Id enum. It has two variants New and Permanent. New is for records which has not been persisted. Permanent is for records which were. Definition of the relm4-store-record::Id pub enum Id<T> where T: ?Sized + Record,
{ /// Id for records which were not committed yet to store New{ /// Value of the id value: <T::Allocator as TemporaryIdAllocator>::Type, }, /// Id for records which are persisted already /// /// What persisted means depends on the store. Permanent { /// Value of the id value: <T::Allocator as TemporaryIdAllocator>::Type, }
} Persistance of the record is something which depends on the store/backend implementation. Some backends might consider persistance to be at the moment of inserting a data into the store. Some when remote server responded with acknowledgment of storing the data. Some when they serialize the content of the store to the hard disk. This transition might require some special attention from you when dealing with records.
